eral statement');_b($doc.getElementById('gen_statement_text'),'The In-MINDD team fully respects your right to privacy, and will not collect any personal information about you on this website without your clear permission. Any personal information which you volunteer to the In-MINDD research team will be treated with the highest standards of security and confidentiality, strictly in accordance with Data Protection legislation.');_b($doc.getElementById('collect_statement'),'Collection and use of personal information');_b($doc.getElementById('collect_statement_text'),'The In-MINDD research team does not collect any personal data about you on this website, apart from information which you volunteer (for example, by completing the online In-MINDD profiler). Any information that you provide in this way is not made available to any third parties, and is used by the In-MINDD research team only in line with the purpose for which you provided it. Any personal data that you provide will be anonymised and may be be used for statistical purposes.<br/>Certain pages on this site provide an option to ask questions by email, or to submit a comment. This information will only be recorded if you choose to send us a message and will only be used for the purpose for which you have provided it.');_b($doc.getElementById('request_stat'),'Requests regarding data supplied via this website');_b($doc.getElementById('request_statement_text'),'On request, we can supply copies of your personal data which you may have supplied via this website. If you wish to obtain such copies, you must contact the In-MINDD research team (see contact details below). <br/>In certain circumstances you may request that data which you have supplied via the website be deleted. If you wish to request a deletion, you would generally be expected to identify some contravention of data protection law in the manner in which the In-MINDD research team processes the data concerned.');_b($doc.getElementById('complaints'),'Comp
